import React from 'react';
import NavigationPanel from '../components/NavigationPanel';
import Modal from '../components/Modal';

const Sigin = () => {
    return (
        <>
            <div>
                <NavigationPanel></NavigationPanel>
                <Modal onSubmit={this.handleSubmit}/>
            </div>
    
        </>
    );
}
  
export default Sigin;
